description:
The Man Who Fell to Earth

Sociopolitical Documentary hosted by Rob Walker, published by BBC broadcasted as part of BBC Our World series in 2014 - English narration


Information
------------------------------

In 2012 the body of a young man was found in a West London Street. He had no identity papers and no-one had reported him missing. Police were unable to trace his next of kin. But thanks to one number in his mobile phone the British police were able to piece together the extraordinary story of this young man's tragic death, thousands of miles from his home. For Our World Rob Walker tells the story of the 'man who fell to earth'.

